import React from 'react';
import classes from './About.module.css';

const About = () => {
  return (
    <ul className={classes}>
        <li>About Us</li>
        <li>FAQ</li>
        <li>PRICE</li>
        <li>TRAINER</li>
        <li>TIMETABLE</li>
        <li>BODY BUILDER</li>
        <li>PRIVACY POLICY</li>
        <li>TERMS & CONDITIONS</li>
        <li>TEAM</li>
    </ul>
  )
}

export default About;
